import React from "react";
import List from "./Lists.js";

export default function Lists({ lists, setTasks }) {
  function changeList(e) {
    setTasks(JSON.parse(e));
  }
  return (
    <List
      lists={lists}
      setTasks={setTasks}
      tasks={list.tasks}
      name={list.name}
      key={list.id}
    />
  );
}
